import React, { Component } from 'react';

const Header = () => {
    return (
        <div>
            <h1> Welcome to PupperIQ </h1>
            <br/>
            <img className='image' src='https://cdn.northstarmoving.com/blog/wp-content/uploads/2014/06/dog-beach-1024x500.jpg' />
            <h3> Take the quiz below to find your perfect pupper </h3>
        </div>
     );
}

export default Header;
